import { WorkList } from "../WorkList";

const onSubmitWork = (event) => {
  event.preventDefault();
  const workName = event.target.workName.value;
  const workTime = parseInt(event.target.workTime.value);
  console.log("INPUT VALUE: ", workName, workTime);
  WorkList.onSubmitWork(event);
};

const onSubmitTime = (event) => {
  event.preventDefault();
  const [hour, minute] = new Date().toTimeString().split(":");
  console.log("INPUT VALUE: ", hour, minute);
};
export const AddWorkWindow = () => {
  return (
    <form onSubmit={onSubmitWork}>
      <input type="text" name="workName" placeholder="추가할 작업명"></input>
      <input type="number" name="workTime" placeholder="작업 시간"></input>
      <button type="submit">SUBMIT</button>
    </form>
  );
};

export const AddWakeTimeWindow = () => {
  return (
    <button onClick={onSubmitTime}>SUBMIT</button>
